import Vue from 'vue'
import router from './router'
import Vuetify from 'vuetify'
import 'vuetify/dist/vuetify.min.css'

Vue.config.productionTip = false

Vue.use(Vuetify)

const vuetify = new Vuetify({
  theme: {
    dark: false, // Postavite na true ako 탑elite dark mode
    themes: {
      light: {
        primary: '#42b983', // Promenite ovo u svoju 탑eljenu boju
      },
    },
  },
})

new Vue({
  router,
  vuetify, // Dodajte Vuetify instancu ovde
  render: h => h(App),
}).$mount('#app')
